CommonData.BannerCustomCSS:
#onetrust-consent-sdk #onetrust-banner-sdk a[href]{
    margin-right: 8px;
}

#onetrust-banner-sdk.otFloatingRoundedCorner {
    position: fixed;
    bottom: 16px !important;
    left: 16px !important;
    width: 375px !important;
    height: 250px !important; /* Preallocate height */
    transition: none; /* Disable initial transitions that can cause CLS */
    animation: fadeIn ease 0.5s;
}

@media only screen and (max-width: 425px) {
    #onetrust-banner-sdk.otFloatingRoundedCorner {
        width: 92% !important;
        height: 290px !important;
        bottom: 10px !important;
        left: 10px !important;
    }
}

@keyframes fadeIn {
    0% { opacity: 0; }
    100% { opacity: 1; }
}
